import React, { Component } from "react";
import styled from "styled-components";

class Table extends Component {
  render() {
    const Div_table_box = styled.div`
      width: 1112px;
      height: 716px;
      border-radius: 3px;
      border: 1px solid rgba(151, 151, 151, 0.39);
      box-shadow: 0 6px 8px 0 rgba(164, 164, 164, 0.28),
      4px 2px 4px 0 rgba(0, 0, 0, 0.09);
      background-color: #ffffff;
      position: relative;
      margin: 0 auto;
      top: -513px;
      overflow: hidden;
      z-index: 200;

    `;

    const Div_table = styled.div`
      display: flex;
      flex-direction: row;
      justify-content: space-around;
    `;

    const Div_table_row = styled.div`
      display: flex;
      flex-direction: column;
      text-align: center;
    `;

    const Hr_table_horizontal_line = styled.hr`
      width: 875px;
      height: 0px;
      border: 1px solid rgba(151, 151, 151, 0.27);
      margin-bottom: 46px;
      margin-top: 90px;
      position: relative;
      top: 9px;
    `;

    const Results_headers_title = styled.p`
      display: inline;
      font-family: "Alegreya Sans", sans-serif;
      font-size: 20px;
      color: #9b9b9b;
      letter-spacing: 0.74px;
      position: relative;
      top: 55px;
      right: -290px;
      margin-right: 280px;
    `;

    const Div_table_title = styled.div`
      display: flex;
      flex-direction: row;
      justify-content: space-around;
    `;

    const P_table_title = styled.p`
      font-family: "Alegreya Sans", sans-serif;
      font-size: 22px;
      color: #9b9b9b;
      letter-spacing: 0.74px;
      position: relative;
      top: -100px;
      margin: 0;
    `;

    const P_table_data = styled.p`
      font-family: "Alegreya Sans", sans-serif;
      font-size: 20px;
      font-weight: 200;
      font-style: normal;
      font-stretch: normal;
      line-height: -1px;
      letter-spacing: 3px;
      text-align: center;
      color: #9b9b9b;
      position: relative;
      top: -47px;
    `;

    const P_table_img = styled.img`
    height: 30px;
    width: 30px;
    position: relative;
    top: -47px;
    margin-bottom: -1px;

    `


    return (
      <Div_table_box>
        <Hr_table_horizontal_line />
        <Div_table>
          <Div_table_row>
            <P_table_title>EMAIL</P_table_title>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
            <P_table_data>taher@gmail.com</P_table_data>
          </Div_table_row>
          <Div_table_row>
            <P_table_title>FOUND</P_table_title>
            <P_table_img src={require('./Assets/Check.svg')}/>
            <P_table_img src={require('./Assets/Check.svg')}/>
            <P_table_img src={require('./Assets/Check.svg')}/>
            <P_table_data>CROSS</P_table_data>
            <P_table_data>CROSS</P_table_data>
            <P_table_data>CROSS</P_table_data>
            <P_table_data>CROSS</P_table_data>
            <P_table_data>CROSS</P_table_data>
          </Div_table_row>
        </Div_table>
      </Div_table_box>
    );
  }
}

export default Table;
